import React from 'react';
import { Row, Col, Image } from 'antd';
import '../../../styles/product.css';
import { Hidden } from '@material-ui/core';
const Product = () => {
  return (
    <Row>
      <Col span={24}>
        <Row>
          <Col
            sm={12}
            md={12}
            xs={24}
            lg={6}
            // span={6}
            style={{
              //   width: 477,
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                width: '100%'
              }}
              className="Image_product"
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                // preview={false}
                preview={{
                  maskClassName: 'Image'
                  // mask:(

                  // )
                }}
              />
              <div className="background_square_yellow"></div>
              <div className="Price">
                <h3 style={{ fontSize: 18 }}>
                  <small
                    style={{
                      fontSize: 12,
                      display: 'inline-block',
                      verticalAlign: 'top'
                    }}
                  >
                    $
                  </small>
                  399
                </h3>
              </div>
            </div>

            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
          <Col
            sm={12}
            // span={6}
            xs={24}
            md={12}
            lg={6}
            style={{
              //   width: 477,
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                display: 'flex',
                justifyContent: 'center'
              }}
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                preview={false}
              />
            </div>
            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
          <Col
            xs={24}
            sm={12}
            md={12}
            lg={6}
            // span={6}
            style={{
              //   width: 477,
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                display: 'flex',
                justifyContent: 'center'
              }}
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                preview={false}
              />
            </div>
            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
          <Col
            xs={24}
            sm={12}
            md={12}
            lg={6}
            // span={6}
            style={{
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                display: 'flex',
                justifyContent: 'center'
              }}
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                preview={false}
              />
            </div>
            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
        </Row>
      </Col>
    </Row>
  );
};

export default Product;
